        public static int ConstrainedSubsetSum(int[] nums, int k)
        {
            var maxValue = nums[0];

            var calc = new int[nums.Length];
            //CalMax(nums, k, calc, 0);

            for (var i = 0; i < nums.Length; i++)
            {
                calc[i] = nums[i];
                var max = calc[i];
                for (var j = i - 1; j >= 0 && i - j <= k; j--)
                {
                    max = Math.Max(max, calc[i] + calc[j]);
                }
                calc[i] = max;
                maxValue = Math.Max(maxValue, Math.Max(nums[i], calc[i]));
            }

            return maxValue;
        }

